    padding: var(--padding-verticle) 2rem;

}

.block__header{
    text-align: center;
    margin-bottom: 4rem;
}

.block__heading{
    margin-top: 0;

}

.block--dark{
    background: black;
    color: #ac9e9e;
}


.block--dark {
    color: #fff;
}

.block--dark h1,
.block--dark h2,
.block--dark h3 {
    color: white;
}

.block--skewed-right {
    padding-bottom: calc(var(--padding-verticle) + 4rem);
    clip-path: polygon(0% 0%, 100% 0%, 100% 100%, 0% 90%);
}

.block--skewed-left{
    padding-bottom: calc(var(--padding-verticle) + 4rem);
    clip-path: polygon(0% 0%, 100% 0%, 100% 90%, 0% 100%);
}

.container{
    max-width: 1140px;
    margin: 0 auto;
}

/* NAVIGATION BAR */

.nav{
    background: black;
    display: flex;
    justify-content: space-between;
    flex-wrap: wrap;
    padding: 0 1rem;
    align-items: center;
}

.nav__list{
    width: 100%;
    margin: 0;
}

.nav__item{
    padding: 0.5rem 2rem; 
    border-bottom: 1px solid #222;
}

.nav__item>a {
    color: rgb(204, 195, 195);
    transition: color 0.3s;
}

.nav__item>a:hover {
    color: #fff;
}

.nav__toggler{
    opacity: 0.5;
    transition: box-shadow .15s;
    cursor: pointer;
}

.nav.collapsible--expanded .nav__toggler{
    opacity: 1;
    box-shadow: 0 0 0 3px rgb(159, 209, 214);
    border-radius: 5px;
}

.nav__brand{
    transform: translateY(5px);
}

@media screen and (min-width: 768px){
    .nav__toggler{
        display: none;
    }

    .nav__list{
        width: auto;
        display: flex;
        font-size: 1.6rem;
        max-height: 100%;
        opacity: 1;
    }

    .nav__item{
        border: 0;
    }

}

/* HERO */


.hero__tagline{
    font-size: 2rem;
    color: #938fa0;
    letter-spacing: 1px;
    margin: 2rem 0 5rem;
}

.hero__image{
    width: 100%;
}

@media screen and (min-width: 768px) {
    .hero {
        padding-top: 0;
    }
    .hero__content{
        text-align: left;
        align-self: center;
    }

}

/* DOMAIN BLOCK */

.block-domain .input-group {
    box-shadow: 0 0 100px 10px rgb(215, 209, 209);
    border: 0;
    margin: 4rem auto;
    max-width: 670px;
}

.block-domain__prices {
    color: var(--color-headings);
    display: grid;
    grid-template-columns: repeat(2, 1fr);
    grid-template-rows: repeat(2, 6rem);
    font-size: 2rem;
    font-weight: 600;
    justify-items: center;
    max-width: 700px;
    margin: 0 auto;
}

@media screen and (min-width: 768px) {
    .block-domain__prices {
        grid-template-columns: repeat(auto-fit, minmax(10rem, 1fr));

    }

}

/* PLANS BLOCK */

.block-plans .grid {
    gap: 8rem 4rem;  
}

.block-plans .card {
    max-width: 500px;
    margin: 0 auto;
}

/* FEATURES */


.feature {
    gap: 4rem 2rem;
    margin: 12rem 0;
}

.feature:first-of-type {
    margin-top: 6rem;
}
.feature__heading {
    margin: 1rem 0;
}

.feature__image {
    width: 100%;
}

@media screen and (min-width:768px) {
    .feature:nth-of-type(even) .feature__content {
        order: 2;
    }

}

/* SHOWCASE BLOCK */

.block-showcase__image > img {
    width: 100%;
}

@media screen and (min-width: 768px) {

    .block-showcase .grid {
        grid-template-columns: 50% 50%;
    }

    .block-showcase__image {

        justify-self: end;
    }
    .block-showcase__image > img {
        width: auto;
        max-width: 700px;

    }
}

 /* FOOTER */

 .footer {
     background: #232323;
 }
 .footer a {
     color: #777;
     transition: color 0.3s;
 }
 .footer a:hover {
     color: white;
 }


 .footer__section {
     padding: 2rem;
     border-bottom: 1px solid pink;
 }

 .footer__section .list {
     margin: 0;
 }

 .footer__heading {
     text-transform: uppercase;
     font-weight: 600;
 }

 .footer__brand {
     margin-top: 5rem;
     text-align: center;
 }

 .footer__brand img {
     /* consider refactoring this and applying it to all images */
     width: 100%;
     max-width: 230px;
 }

 .footer__copyright {
     font-size: 2.1rem;
     color: #fff;
     opacity: 0.3;
 }

 @media screen and (min-width: 768px) {
    .footer__sections {
        grid-template-columns: repeat(auto-fit, minmax(10rem, 1fr));
    }
    .footer .collapsible__chevron {
        display: none;
    }

    .footer .collapsible__content {
       opacity: 1;
       max-height: 100%;
    }

    .footer__brand {
        order: -1;
        margin-top: 1rem;
    }

    .footer__copyright {
        font-size: 1.5rem;
    }

    .footer__section {
        border: 0;
    }

    .footer__heading {
        font-size: 1.6rem;
    }

 }

