        background-color: var(--color-secondary);
        color: white;
    }

    .card--primary .badge--primary {
        background: black;
    }

    .card--secondary .badge--secondary {
        background: black;
    }

    /* PLANS */

    .plan {
        transition: transform .2s ease-in-out;
    }

    .plan__name {
        color: white;
        margin: 0;
        font-weight: 500;
        font-size: 2.4rem;

    }
    .plan__price {
        font-size: 6rem;
    }
    .plan__billing-cycle {
        font-size: 2.4rem;
        font-weight: 300;
        opacity: 0.8;
        margin-right: 1rem;
    }
    .plan__description {
        font-size: 2rem;
        font-weight: 300;
        letter-spacing: 1px;
        display: block;
    }

    .plan .plan__list {
        margin-bottom: 2rem;
    }

    .plan--popular {
        transform: scale(1.1);
    }
    .plan--popular .card__header {
        position: relative;
    }
    .plan--popular .card__header::before {
        content: url(/images/popular.svg);
        width: 40px;
        display: inline-block;
        position: absolute;
        top: -6px;
        right: 5%;
    }

    .plan:hover {
        transform: scale(1.05);
    }
    .plan--popular:hover {
        transform: scale(1.15);
    }

    @media screen and (min-width:1024px)
    {
        .plan__name {
            font-size: 1.4rem;
        }
        .plan_price {
            font-size: 5rem;
        }
        .plan__building--cycle {
            font-size: 1.6rem;
        }
        .plan__description {
            font-size: 1.7rem;
        }

    }

    /* MEDIA */

    .media {
        display: flex;
        margin-bottom: 4rem;

    }
    .media__title {
        margin: 0;

    }

    .media__body {
        margin: 0 2rem;
    }
    .media__image {
        margin: 1rem;
    }

    /* QUOTES */

    .quote {
        font-size: 3rem;
        font-style: italic;
        color: var(--color-body-darker);
        line-height: 1.3;
    }
    .quote__text:before {
        content: open-quote;
    }
    .quote__text:after{
        content: close-quote;

    }
 .quote__author {
     font-size: 3rem;
     font-weight: 500;
     font-style: normal;
    margin-bottom: 0;
 }
 .quote__company {
     color: var(--color-headings);
     opacity: .4;
     font-size: 2rem;
     font-style: normal;
 }
 .quote__line {
     position: relative;
     bottom: 10px;

 }
 @media screen and (min-width: 1024px) {
     .quote {
         font-size: 2rem;
     }
     .quote__author {
         font-size: 2.4rem;
     }
     .quote__company {
         font-size: 1.6rem;

     }
 }
 /* GRIDS */
.grid {
    display: grid;
}
@media screen and (min-width: 768px) {
    .grid--1x2 {
        grid-template-columns: repeat(2, 1fr);
    }

}
@media screen and (min-width: 1024px) {
    .grid--1x3 {
        grid-template-columns: repeat(3, 1fr);
    }

}

/* TESTIMONIAL */

.testimonial {
    padding: 3rem;
}

.testimonial__image {
    position: relative;
}

.testimonial__image > img {
    width: 100%;

}
.testimonial__image > .icon-container {
    position: absolute;
    top: 3rem;
    right: -32px;
}

@media  screen and (min-width: 768px) {
    .testimonial .quote, .testimonial .quote__author {
        font-size: 2.4rem;
    }
    .testimonial .quote {
        margin-left: 6rem;
    }
}

/* CALLOUTS */

.callout {
    padding: 4rem;
    border-radius: 5px;
}


.callout--primary {
    background: var(--color-primary);
    color: white;
}
.callout__heading {
    color: white;
    margin-top: 0;
    font-size: 3rem;
}
.callout .btn {
    justify-self: center;
    align-self: center;
}

.callout__content {
    text-align: center;
}


@media screen and (min-width: 768px) {

    .callout .grid--1x2 {
        grid-template-columns: 1fr auto;
    }
    .callout__content {
        text-align: left;
    }
    .callout .btn {
        justify-self: start;
        margin: 0 2rem;
    }


}

/* COLLAPSIBLE */

.collapsible__header {
    display: flex;
    justify-content: space-between;
}
.collapsible__heading {
    margin-top: 0;
    font-size: 3rem;
}
.collapsible__chevron {
    transform: rotate(-90deg);
    transition: transform 0.3s;
}

.collapsible__content {
    overflow: hidden;
    max-height: 0;
    opacity: 0;
    transition: all 0.3s;
}

.collapsible--expanded .collapsible__chevron {
    transform: rotate(0);
}
.collapsible--expanded .collapsible__content {
    max-height: 100vh;
    opacity: 1; 

}

/* BLOCKS */

.block{
    --padding-verticle: 6rem;
    padding: var(--padding-verticle) 2rem;

}

.block__header{
    text-align: center;
    margin-bottom: 4rem;
}

.block__heading{
    margin-top: 0;

}

.block--dark{
    background: black;
    color: #ac9e9e;
}


.block--dark {
    color: #fff;
}

.block--dark h1,
.block--dark h2,
.block--dark h3 {
    color: white;
}

.block--skewed-right {
    padding-bottom: calc(var(--padding-verticle) + 4rem);
    clip-path: polygon(0% 0%, 100% 0%, 100% 100%, 0% 90%);
}

.block--skewed-left{
    padding-bottom: calc(var(--padding-verticle) + 4rem);
    clip-path: polygon(0% 0%, 100% 0%, 100% 90%, 0% 100%);
}

.container{
    max-width: 1140px;
    margin: 0 auto;
}

/* NAVIGATION BAR */

.nav{
    background: black;
    display: flex;
    justify-content: space-between;
    flex-wrap: wrap;
    padding: 0 1rem;
    align-items: center;
}

.nav__list{
    width: 100%;
    margin: 0;
}

.nav__item{
    padding: 0.5rem 2rem; 
    border-bottom: 1px solid #222;
}

.nav__item>a {
    color: rgb(204, 195, 195);
    transition: color 0.3s;
}

.nav__item>a:hover {
    color: #fff;
}

.nav__toggler{
    opacity: 0.5;
    transition: box-shadow .15s;
    cursor: pointer;
}

.nav.collapsible--expanded .nav__toggler{
    opacity: 1;
    box-shadow: 0 0 0 3px rgb(159, 209, 214);
    border-radius: 5px;
}

.nav__brand{
    transform: translateY(5px);
}

@media screen and (min-width: 768px){
    .nav__toggler{
        display: none;
    }

    .nav__list{
        width: auto;
        display: flex;
        font-size: 1.6rem;
        max-height: 100%;
        opacity: 1;
    }

    .nav__item{
        border: 0;
    }

}

/* HERO */


.hero__tagline{
    font-size: 2rem;
    color: #938fa0;
    letter-spacing: 1px;
    margin: 2rem 0 5rem;
}

.hero__image{
    width: 100%;
}

@media screen and (min-width: 768px) {
    .hero {
        padding-top: 0;
    }
    .hero__content{
        text-align: left;
        align-self: center;
    }

}

/* DOMAIN BLOCK */

.block-domain .input-group {
    box-shadow: 0 0 100px 10px rgb(215, 209, 209);
    border: 0;
    margin: 4rem auto;
    max-width: 670px;
}

.block-domain__prices {
    color: var(--color-headings);
    display: grid;
    grid-template-columns: repeat(2, 1fr);
    grid-template-rows: repeat(2, 6rem);
    font-size: 2rem;
    font-weight: 600;
    justify-items: center;
    max-width: 700px;
    margin: 0 auto;
}

@media screen and (min-width: 768px) {
    .block-domain__prices {
        grid-template-columns: repeat(auto-fit, minmax(10rem, 1fr));

    }

}

/* PLANS BLOCK */

.block-plans .grid {
    gap: 8rem 4rem;  
}

.block-plans .card {
    max-width: 500px;
    margin: 0 auto;
}

/* FEATURES */


.feature {
    gap: 4rem 2rem;
    margin: 12rem 0;
}

.feature:first-of-type {
    margin-top: 6rem;
}
.feature__heading {
    margin: 1rem 0;
}

.feature__image {
    width: 100%;
}

@media screen and (min-width:768px) {
    .feature:nth-of-type(even) .feature__content {
        order: 2;
    }

}

/* SHOWCASE BLOCK */

.block-showcase__image > img {
    width: 100%;
}

@media screen and (min-width: 768px) {

    .block-showcase .grid {
        grid-template-columns: 50% 50%;
    }

    .block-showcase__image {

        justify-self: end;
    }
    .block-showcase__image > img {
        width: auto;
        max-width: 700px;

    }
}

 /* FOOTER */

 .footer {
     background: #232323;
 }
 .footer a {
     color: #777;
     transition: color 0.3s;
 }
 .footer a:hover {
     color: white;
 }


 .footer__section {
     padding: 2rem;
     border-bottom: 1px solid pink;
 }

 .footer__section .list {
     margin: 0;
 }

 .footer__heading {
     text-transform: uppercase;
     font-weight: 600;
 }

 .footer__brand {
     margin-top: 5rem;
     text-align: center;
 }

 .footer__brand img {
     /* consider refactoring this and applying it to all images */
     width: 100%;
     max-width: 230px;
 }

 .footer__copyright {
     font-size: 2.1rem;
     color: #fff;
     opacity: 0.3;
 }

 @media screen and (min-width: 768px) {
    .footer__sections {
        grid-template-columns: repeat(auto-fit, minmax(10rem, 1fr));
    }
    .footer .collapsible__chevron {
        display: none;
    }

    .footer .collapsible__content {
       opacity: 1;
       max-height: 100%;
    }

    .footer__brand {
        order: -1;
        margin-top: 1rem;
    }

    .footer__copyright {
        font-size: 1.5rem;
    }

    .footer__section {
        border: 0;
    }

    .footer__heading {
        font-size: 1.6rem;
    }

 }
